"use strict";(self.webpackChunkthinkingdata_docs=self.webpackChunkthinkingdata_docs||[]).push([[614],{9260:n=>{n.exports=JSON.parse('{"blogPosts":[{"id":"welcome","metadata":{"permalink":"/thinkingdata-docs/blog/welcome","editUrl":"https://github.com/wo123kr/thinkingdata-docs/tree/main/blog/2024-01-15-welcome.md","source":"@site/blog/2024-01-15-welcome.md","title":"ThinkingData \ubb38\uc11c\uc5d0 \uc624\uc2e0 \uac83\uc744 \ud658\uc601\ud569\ub2c8\ub2e4","description":"\uc548\ub155\ud558\uc138\uc694! ThinkingData \ud50c\ub7ab\ud3fc\uc758 \uacf5\uc2dd \ubb38\uc11c \uc0ac\uc774\ud2b8\uc5d0 \uc624\uc2e0 \uac83\uc744 \ud658\uc601\ud569\ub2c8\ub2e4.","date":"2024-01-15T00:00:00.000Z","formattedDate":"2024\ub144 1\uc6d4 15\uc77c","tags":[{"label":"welcome","permalink":"/thinkingdata-docs/blog/tags/welcome"},{"label":"introduction","permalink":"/thinkingdata-docs/blog/tags/introduction"}],"readingTime":2.535,"hasTruncateMarker":false,"authors":[],"frontMatter":{"slug":"welcome","title":"ThinkingData \ubb38\uc11c\uc5d0 \uc624\uc2e0 \uac83\uc744 \ud658\uc601\ud569\ub2c8\ub2e4","tags":["welcome","introduction"]},"unlisted":false},"content":"\uc548\ub155\ud558\uc138\uc694! ThinkingData \ud50c\ub7ab\ud3fc\uc758 \uacf5\uc2dd \ubb38\uc11c \uc0ac\uc774\ud2b8\uc5d0 \uc624\uc2e0 \uac83\uc744 \ud658\uc601\ud569\ub2c8\ub2e4.\\n\\n## \ud83d\ude80 \uc0c8\ub85c\uc6b4 \uc2dc\uc791\\n\\n\uc774 \ubb38\uc11c \uc0ac\uc774\ud2b8\ub294 GitBook \uc2a4\ud0c0\uc77c\uc758 \ud604\ub300\uc801\uc774\uace0 \uc9c1\uad00\uc801\uc778 \uc778\ud130\ud398\uc774\uc2a4\ub97c \uc81c\uacf5\ud558\uc5ec, \uac1c\ubc1c\uc790\ub4e4\uc774 ThinkingData \ud50c\ub7ab\ud3fc\uc744 \uc27d\uac8c \uc774\ud574\ud558\uace0 \uc0ac\uc6a9\ud560 \uc218 \uc788\ub3c4\ub85d \uc124\uacc4\ub418\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n## \ud83d\udcda \uc81c\uacf5\ub418\ub294 \ub0b4\uc6a9\\n\\n- **\uc2dc\uc791\ud558\uae30 \uac00\uc774\ub4dc**: \ud50c\ub7ab\ud3fc \uc0ac\uc6a9\uc744 \uc704\ud55c \uccab \ub2e8\uacc4\\n- **API \ucc38\uc870**: REST API \uc5d4\ub4dc\ud3ec\uc778\ud2b8 \ubb38\uc11c\\n- **SDK \uac00\uc774\ub4dc**: \ub2e4\uc591\ud55c \ud504\ub85c\uadf8\ub798\ubc0d \uc5b8\uc5b4 SDK \uc0ac\uc6a9\ubc95\\n- **\uc124\uce58 \uac00\uc774\ub4dc**: \ud658\uacbd\ubcc4 \uc124\uce58 \ubc29\ubc95\\n- **\uc124\uc815 \uac00\uc774\ub4dc**: \uace0\uae09 \uc124\uc815 \ubc0f \ucd5c\uc801\ud654\\n- **\ub370\uc774\ud130 \ubaa8\ub378\ub9c1**: \ud6a8\uc728\uc801\uc778 \ub370\uc774\ud130 \uad6c\uc870 \uc124\uacc4\\n- **\uc131\ub2a5 \ucd5c\uc801\ud654**: \ub300\uc6a9\ub7c9 \ub370\uc774\ud130 \ucc98\ub9ac \ucd5c\uc801\ud654\\n- **\ubcf4\uc548 \uac00\uc774\ub4dc**: \ub370\uc774\ud130 \ubcf4\uc548 \ubc0f \uc811\uadfc \uc81c\uc5b4\\n\\n## \ud83c\udfaf \uc8fc\uc694 \uae30\ub2a5\\n\\n- **GitBook \uc2a4\ud0c0\uc77c UI**: \uae54\ub054\ud558\uace0 \ud604\ub300\uc801\uc778 \ubb38\uc11c \uc778\ud130\ud398\uc774\uc2a4\\n- **\ub2e4\ud06c/\ub77c\uc774\ud2b8 \ubaa8\ub4dc**: \uc0ac\uc6a9\uc790 \uc120\ud638\ub3c4\uc5d0 \ub530\ub978 \ud14c\ub9c8 \uc804\ud658\\n- **\uc2e4\uc2dc\uac04 \uac80\uc0c9**: \ube60\ub974\uace0 \uc815\ud655\ud55c \ubb38\uc11c \uac80\uc0c9\\n- **\ubc18\uc751\ud615 \ub514\uc790\uc778**: \ubaa8\ubc14\uc77c, \ud0dc\ube14\ub9bf, \ub370\uc2a4\ud06c\ud1b1 \uc9c0\uc6d0\\n- **\ucf54\ub4dc \ud558\uc774\ub77c\uc774\ud305**: \ub2e4\uc591\ud55c \ud504\ub85c\uadf8\ub798\ubc0d \uc5b8\uc5b4 \uc9c0\uc6d0\\n\\n## \ud83d\udd17 \ube60\ub978 \ub9c1\ud06c\\n\\n- [\uc2dc\uc791\ud558\uae30](/docs/intro) - \ud50c\ub7ab\ud3fc \uc18c\uac1c \ubc0f \uccab \ub2e8\uacc4\\n- [API \ucc38\uc870](/docs/api/reference) - REST API \ubb38\uc11c\\n- [SDK \uac00\uc774\ub4dc](/docs/api/sdk) - \ub2e4\uc591\ud55c \uc5b8\uc5b4 SDK \uc0ac\uc6a9\ubc95\\n- [\uc124\uce58 \uac00\uc774\ub4dc](/docs/guides/installation) - \ud658\uacbd\ubcc4 \uc124\uce58 \ubc29\ubc95\\n\\n## \ud83e\udd1d \uae30\uc5ec\ud558\uae30\\n\\n\uc774 \ubb38\uc11c\ub294 \uc9c0\uc18d\uc801\uc73c\ub85c \uac1c\uc120\ub418\uace0 \uc788\uc2b5\ub2c8\ub2e4. \uc624\ub958\ub97c \ubc1c\uacac\ud558\uac70\ub098 \uac1c\uc120 \uc81c\uc548\uc774 \uc788\uc73c\uc2dc\uba74 [GitHub Issues](https://github.com/wo123kr/thinkingdata-docs/issues)\uc5d0 \ubb38\uc758\ud574\uc8fc\uc138\uc694.\\n\\n## \ud83d\udcde \uc9c0\uc6d0\\n\\n- **\ubb38\uc11c**: \uc774 \uc0ac\uc774\ud2b8\uc758 \uac00\uc774\ub4dc\uc640 API \ucc38\uc870\ub97c \ud655\uc778\ud558\uc138\uc694\\n- **GitHub**: [Issues](https://github.com/wo123kr/thinkingdata-docs/issues)\uc5d0\uc11c \ubc84\uadf8 \ub9ac\ud3ec\ud2b8 \ubc0f \uae30\ub2a5 \uc694\uccad\\n- **\ucee4\ubba4\ub2c8\ud2f0**: [Discord](https://discord.gg/thinkingdata)\uc5d0\uc11c \ub2e4\ub978 \uac1c\ubc1c\uc790\ub4e4\uacfc \uc18c\ud1b5\\n\\n---\\n\\n**ThinkingData \ud300**\uc774 \ud568\uaed8 \ub9cc\ub4e4\uc5b4\uac00\ub294 \ub354 \ub098\uc740 \ub370\uc774\ud130 \ubd84\uc11d \ud50c\ub7ab\ud3fc\uc744 \uae30\ub300\ud574\uc8fc\uc138\uc694! \ud83c\udf89"}]}')}}]);